import { connect } from 'react-redux';
import { bindActionCreators } from 'redux';
import * as partiesActions from '../../actions/partiesActions';
import React from 'react';


class partiesList extends React.Component {
  renderData() {
    return <div>{this.props.stuffs}</div>;
  }


  render() {
    return (
      <div className="">
          {this.props.stuffs.length > 0 ?
            this.renderData()
            :
            <div className="">
              No Data
            </div>
          }
      </div>
    );
  }
}

function mapStateToProps(state) {
  return {
    parties: state.parties.parties
  };
}

function mapDispatchToProps(dispatch) {
  return {
    partiesActions: bindActionCreators(partiesActions, dispatch)
  };
}

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(partiesList);
